package string;

import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertTrue;

class PermutationInStringTest {

    @Test
    void isPermutation() {
        PermutationInString.SolutionSW tbt = new PermutationInString.SolutionSW();
        assertTrue(tbt.checkInclusion("ab", "eidbaooo"));
        PermutationInString.SolutionMap tbt2 = new PermutationInString.SolutionMap();
        assertTrue(tbt2.checkInclusion("",
                ""));
    }

}